// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../Imports/Ownable.sol";
import "../Imports/AccessControl.sol";

contract CompanyMaster is Ownable, AccessControl {
    // Define roles using keccak256 hash
    bytes32 public constant POLL_MANAGER_ROLE = keccak256("POLL_MANAGER_ROLE");
    bytes32 public constant TOKEN_MANAGER_ROLE = keccak256("TOKEN_MANAGER_ROLE");
    bytes32 public constant USER_MANAGER_ROLE = keccak256("USER_MANAGER_ROLE");

    // Addresses of child contracts for easy access and management
    address public tokenContract;
    address public userContract;
    address public pollContract;
    address internal companyAddress;


    // Event logging for contract deployments and critical actions
    event ContractDeployed(string contractType, address deployedAddress);

    constructor(address _companyAddress) Ownable(msg.sender) {
        // Grant the default admin role to the deployer
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
        companyAddress = _companyAddress == address(0) ? msg.sender : _companyAddress;

        // Set admin roles for manageable roles
        _setRoleAdmin(POLL_MANAGER_ROLE, DEFAULT_ADMIN_ROLE);
        _setRoleAdmin(TOKEN_MANAGER_ROLE, DEFAULT_ADMIN_ROLE);
        _setRoleAdmin(USER_MANAGER_ROLE, DEFAULT_ADMIN_ROLE);
    }

    // Function to deploy Token Contract
    function deployTokenContract(address _tokenContract) public onlyOwner {
        tokenContract = _tokenContract;
        emit ContractDeployed("TokenContract", _tokenContract);
    }

    // Function to deploy User Contract
    function deployUserContract(address _userContract) public onlyOwner {
        userContract = _userContract;
        emit ContractDeployed("UserContract", _userContract);
    }

    // Function to deploy Poll Contract
    function deployPollContract(address _pollContract) public onlyOwner {
        pollContract = _pollContract;
        emit ContractDeployed("PollContract", _pollContract);
    }

    // Example of a secured function that only a user manager can perform
    function manageUser(address user, bool isActive) public onlyRole(USER_MANAGER_ROLE) {
        // Logic to activate or deactivate a user
    }

    // Setup roles for different functionalities
    function setupRole(bytes32 role, address account) public onlyOwner {
        _grantRole(role, account);
    }
}

contracts/LoyaltyToken.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../Imports/ERC20.sol";
import "../Imports/AccessControl.sol";

contract LoyaltyToken is ERC20, AccessControl {
    // Define roles for minting and burning tokens
    bytes32 public constant MINTER_ROLE = keccak256("MINTER_ROLE");
    bytes32 public constant BURNER_ROLE = keccak256("BURNER_ROLE");

    constructor() ERC20("LoyaltyToken", "LTY") {
        // Grant the contract deployer the default admin role: they can manage other roles
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    // Function to mint new tokens, accessible only by minters
    function mint(address to, uint256 amount) public onlyRole(MINTER_ROLE) {
        _mint(to, amount);
    }

    // Function to burn tokens from a holder, accessible only by burners
    function burn(address from, uint256 amount) public onlyRole(BURNER_ROLE) {
        _burn(from, amount);
    }

    // Setup a new minter
    function setupMinter(address minter) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _grantRole(MINTER_ROLE, minter);
    }

    // Setup a new burner
    function setupBurner(address burner) public onlyRole(DEFAULT_ADMIN_ROLE) {
        _grantRole(BURNER_ROLE, burner);
    }
}

contracts/PollContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../Imports/AccessControl.sol";
import "../Imports/IERC20.sol";

interface ITokenContract {
    function mint(address to, uint256 amount) external;
}

contract PollContract is AccessControl {
    struct Poll {
        uint256 id;
        string question;
        string[] options;
        bool isActive;
        mapping(address => bool) hasVoted; // Mapping to track if a voter has voted
        mapping(uint256 => uint256) votes; // Mapping to track votes per option
    }

    Poll[] public polls;
    bytes32 public constant POLL_MANAGER_ROLE = keccak256("POLL_MANAGER_ROLE");
    ITokenContract public tokenContract; // Using the ITokenContract interface

    event PollCreated(uint256 id, string question);
    event PollActivated(uint256 id);
    event PollClosed(uint256 id);
    event Voted(address voter, uint256 pollId, uint256 option);

    constructor(address _tokenContract) {
        tokenContract = ITokenContract(_tokenContract);  // Initialize the token contract interface
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function createPoll(string memory question, string[] memory options) public onlyRole(POLL_MANAGER_ROLE) {
        Poll storage newPoll = polls.push();
        newPoll.id = polls.length - 1;
        newPoll.question = question;
        newPoll.options = options;
        newPoll.isActive = false;
        emit PollCreated(newPoll.id, question);
    }

    function activatePoll(uint256 pollId) public onlyRole(POLL_MANAGER_ROLE) {
        require(pollId < polls.length, "Poll does not exist.");
        polls[pollId].isActive = true;
        emit PollActivated(pollId);
    }

    function closePoll(uint256 pollId) public onlyRole(POLL_MANAGER_ROLE) {
        require(pollId < polls.length, "Poll does not exist.");
        polls[pollId].isActive = false;
        emit PollClosed(pollId);
    }

    function vote(uint256 pollId, uint256 option) public {
        require(pollId < polls.length, "Poll does not exist.");
        require(polls[pollId].isActive, "Poll is not active.");
        require(!polls[pollId].hasVoted[msg.sender], "Already voted.");

        polls[pollId].votes[option]++;
        polls[pollId].hasVoted[msg.sender] = true;
        emit Voted(msg.sender, pollId, option);

        // Reward the voter with tokens
        tokenContract.mint(msg.sender, 1);
    }
}

contracts/UserContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../Imports/AccessControl.sol";
import "../Imports/IERC20.sol";

contract UserContract is AccessControl {
    struct UserProfile {
        uint256 uid;
        uint256 tokenBalance;
        uint256 storeCredit; // Store credit in USD cents
        mapping(uint256 => bool) pollsParticipated;
        string[] votingRecords;
    }

    mapping(address => UserProfile) public userProfiles;
    address public tokenContract;
    uint256 private nextUid = 1;
    bytes32 public constant USER_MANAGER_ROLE = keccak256("USER_MANAGER_ROLE");

    event UserRegistered(address indexed user, uint256 uid);
    event TokensDeposited(address indexed user, uint256 amount);
    event VoteRecorded(address indexed user, uint256 pollId, string vote);
    event TokensRedeemed(address indexed user, uint256 tokens, uint256 credit);

    constructor(address _tokenContract) {
        tokenContract = _tokenContract;
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function registerUser(address userAddress) public onlyRole(USER_MANAGER_ROLE) {
        require(userProfiles[userAddress].uid == 0, "User already registered");
        userProfiles[userAddress].uid = nextUid++;
        emit UserRegistered(userAddress, userProfiles[userAddress].uid);
    }

    function depositTokens(address userAddress, uint256 amount) public onlyRole(USER_MANAGER_ROLE) {
        require(IERC20(tokenContract).transferFrom(msg.sender, address(this), amount), "Token transfer failed");
        userProfiles[userAddress].tokenBalance += amount;
        emit TokensDeposited(userAddress, amount);
    }

    function recordVote(address userAddress, uint256 pollId, string memory vote) public onlyRole(USER_MANAGER_ROLE) {
        require(!userProfiles[userAddress].pollsParticipated[pollId], "User already voted in this poll");
        userProfiles[userAddress].pollsParticipated[pollId] = true;
        userProfiles[userAddress].votingRecords.push(vote);
        emit VoteRecorded(userAddress, pollId, vote);
    }

    function redeemTokensForCredit(address userAddress, uint256 tokenAmount) public {
        require(userProfiles[userAddress].tokenBalance >= tokenAmount, "Insufficient tokens");
        uint256 credit = 0;
        while (tokenAmount >= 10) { // The smallest tier
            if (tokenAmount >= 100) {
                credit += 4000; // $40 in cents
                tokenAmount -= 100;
            } else if (tokenAmount >= 50) {
                credit += 1500; // $15 in cents
                tokenAmount -= 50;
            } else if (tokenAmount >= 20) {
                credit += 500;  // $5 in cents
                tokenAmount -= 20;
            } else if (tokenAmount >= 10) {
                credit += 200;  // $2 in cents
                tokenAmount -= 10;
            }
        }

        userProfiles[userAddress].tokenBalance -= (tokenAmount - credit);
        userProfiles[userAddress].storeCredit += credit;
        emit TokensRedeemed(userAddress, tokenAmount, credit);
    }

    function getTokenBalance(address userAddress) public view returns (uint256) {
        return userProfiles[userAddress].tokenBalance;
    }

    function getVotingRecords(address userAddress) public view returns (string[] memory) {
        return userProfiles[userAddress].votingRecords;
    }

    function getStoreCredit(address userAddress) public view returns (uint256) {
        return userProfiles[userAddress].storeCredit;
    }
}

contracts/VotingContract.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "../Imports/AccessControl.sol";
import "../Imports/IERC20.sol";

contract VotingContract is AccessControl {
    struct Vote {
        uint256 pollId;
        mapping(uint256 => uint256) optionCounts; // Counts votes per option
        mapping(address => bool) hasVoted; // Tracks if a user has voted
    }

    // Mapping from poll IDs to their voting data
    mapping(uint256 => Vote) public votes;

    // Access control role constants
    bytes32 public constant VOTE_MANAGER_ROLE = keccak256("VOTE_MANAGER_ROLE");
    address public tokenContract; // Address of the Token Contract for rewards

    // Events for vote casting
    event VoteCasted(uint256 indexed pollId, address indexed voter, uint256 option);

    constructor(address _tokenContract) {
        tokenContract = _tokenContract;
        _grantRole(DEFAULT_ADMIN_ROLE, msg.sender);
    }

    function castVote(uint256 pollId, uint256 option) public onlyRole(VOTE_MANAGER_ROLE) {
        require(!votes[pollId].hasVoted[msg.sender], "You have already voted in this poll.");

        votes[pollId].optionCounts[option]++;
        votes[pollId].hasVoted[msg.sender] = true;

        emit VoteCasted(pollId, msg.sender, option);

        // Assuming there's a method to mint tokens in the Token Contract
        // This would require the Token Contract to have a mint function accessible by this contract
        IERC20(tokenContract).transfer(msg.sender, 1); // Reward 1 token per vote cast, for example
    }

    // Function to check if a user has voted in a specific poll
    function hasVoted(uint256 pollId, address voter) public view returns (bool) {
        return votes[pollId].hasVoted[voter];
    }
}

